import axios from 'axios';
import { apiEndpoint } from './apiConfig';

export async function getMove(board, player) {
  var move = -1;
    await axios.post(`${apiEndpoint}/getMove`, {
      setTimeout: 8000,
      data: {
        board: board,
        player: player
      }
    }).then((response) => {
      move = response.data
    })
    return move
}
